import React from 'react';
import '../App.css';



const Goals = () => {
   return (
        <div className='frame1'> 
            <h2 className= 'Port-header'>In life:</h2> 
            <li className = 'Port-basic'>- To do my part in increasinf fairness and equality.</li>
            <li className = 'Port-basic'>- To inspire and encourage others along the way.</li>
            <li className = 'Port-basic'>- To find new angles, views and ways to build better world.</li>

            <h2 className= 'Port-header2'>In UX-design:</h2> 
            <li className = 'Port-basic'>- To interact and work with people from different field to 
            get wider views and co-operation</li>
            <li className = 'Port-basic'>- To raise and emphasize also those voices that are not as easily heard.</li>
            <li className = 'Port-basic'>- To develope my skill set and keep ideas fresh and interesting - also for myself.</li>

        </div>

        )
}

export default Goals
